import React, { useState, useEffect } from "react";
import Select from "react-select"; // Import React-Select
import axios from "axios";
import campaigns from "./campaigns";
import statesDistricts from "./statesDistricts.json";
import "./App.css";

const App = () => {
  const [formData, setFormData] = useState({
    month: "",
    state: "",
    district: "",
    village: "",
    customVillage: "",
    block: "",
    campaignsData: {},
  });

  const [states, setStates] = useState([]);
  const [districtOptions, setDistrictOptions] = useState([]);
  const [villageOptions, setVillageOptions] = useState([]);
  const [showPopup, setShowPopup] = useState(false);
  const [submittedData, setSubmittedData] = useState(null);

  const months = [
    "January",
    "February",
    "March",
    "April",
    "May",
    "June",
    "July",
    "August",
    "September",
    "October",
    "November",
    "December",
  ];

  useEffect(() => {
    const uniqueStates = [
      ...new Set(statesDistricts.map((item) => item.STATE)),
    ];
    setStates(uniqueStates.sort());

    const initialCampaignsData = {};
    campaigns.forEach((campaign) => {
      initialCampaignsData[campaign.id] = { quantity: "", amount: "" };
    });
    setFormData((prev) => ({ ...prev, campaignsData: initialCampaignsData }));
  }, []);

  const handleStateChange = (selectedOption) => {
    const selectedState = selectedOption.value;
    setFormData({ ...formData, state: selectedState, district: "", village: "" });

    const filteredDistricts = [
      ...new Set(
        statesDistricts
          .filter((item) => item.STATE === selectedState)
          .map((item) => item.DISTRICT)
      ),
    ];

    setDistrictOptions(
      filteredDistricts.sort().map((district) => ({
        value: district,
        label: district,
      }))
    );
  };

  const handleDistrictChange = (selectedOption) => {
    const selectedDistrict = selectedOption.value;
    setFormData({ ...formData, district: selectedDistrict, village: "" });

    const filteredVillages = [
      ...new Set(
        statesDistricts
          .filter((item) => item.DISTRICT === selectedDistrict)
          .map((item) => item.Village)
      ),
    ];

    setVillageOptions(
      filteredVillages.sort().map((village) => ({
        value: village,
        label: village,
      }))
    );
  };

  const handleVillageChange = (selectedOption) => {
    setFormData({ ...formData, village: selectedOption.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setSubmittedData(formData);
    setShowPopup(true);
  };

  return (
    <div className="container">
      <h1>Service Campaign Form</h1>
      <form onSubmit={handleSubmit}>
        <div className="white-box">
          <h2>Location Details</h2>

          <label>Month</label>
          <select
            value={formData.month}
            onChange={(e) => setFormData({ ...formData, month: e.target.value })}
            required
          >
            <option value="">Select a month</option>
            {months.map((month) => (
              <option key={month} value={month}>
                {month}
              </option>
            ))}
          </select>

          <label>State</label>
          <Select
            options={states.map((state) => ({ value: state, label: state }))}
            onChange={handleStateChange}
            placeholder="Select a state"
          />

          <label>District</label>
          <Select
            options={districtOptions}
            onChange={handleDistrictChange}
            placeholder="Select a district"
            isDisabled={districtOptions.length === 0} // Disable if no options available
          />

          <label>Village/Zone</label>
          <Select
            options={villageOptions}
            onChange={handleVillageChange}
            placeholder="Select a village"
            isDisabled={villageOptions.length === 0} // Disable if no options available
          />
        </div>

        <button type="submit">Submit</button>
      </form>

      {showPopup && submittedData && (
        <div className="popup">
          <div className="popup-content">
            <h3>Confirm Submission</h3>
            <p>
              <strong>Month:</strong> {submittedData.month}
            </p>
            <p>
              <strong>State:</strong> {submittedData.state}
            </p>
            <p>
              <strong>District:</strong> {submittedData.district}
            </p>
            <p>
              <strong>Village:</strong> {submittedData.village}
            </p>
            <button onClick={() => setShowPopup(false)}>Close</button>
          </div>
        </div>
      )}
    </div>
  );
};

export default App;
